func And(predicates ...predicate.CustomTypeEnum) predicate.CustomTypeEnum {
	return predicate.CustomTypeEnum(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.CustomTypeEnum) predicate.CustomTypeEnum {
	return predicate.CustomTypeEnum(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.CustomTypeEnum) predicate.CustomTypeEnum {
	return predicate.CustomTypeEnum(sql.NotPredicates(p))
}
